// src/AboutUs.jsx
import React from "react";

function AboutUs() {
  return (
    <div className="p-10">
      <h1 className="text-4xl font-bold mb-4">About Us</h1>
      <p className="text-lg text-gray-700">
        We are a team of licensed electricians providing top-quality electrical
        services. Our mission is to ensure safety, efficiency, and satisfaction
        for every customer.
      </p>
    </div>
  );
}

export default AboutUs;
